import React from 'react';

const CustomerDetail = (props) => {
    if(!props.customer){
        return null
    }
    return(
        <div className="customer-item-details">
            <ul >
                <div>{props.customer.firstName}</div>
            </ul>
        </div>
    )
}

export default CustomerDetail;
